import React from 'react';
import {
  Navbar,
  Footer,
  HeroSection,
  VisionMissionValues,
  ImpactStats,
  NewsSection,
  PartnersSection,
  DonationSection,
  NewsletterSection
} from './components';
import './App.css';

const App: React.FC = () => {
  return (
    <div>
      <Navbar />
      <HeroSection />
      <VisionMissionValues />
      <ImpactStats />
      <NewsSection />
      <PartnersSection />
      <DonationSection />
      <NewsletterSection />
      <Footer />
    </div>
  );
};

export default App;
